INSERT INTO `taxtinfo` (`id`, `header_title`, `social_links`, `msg1`, `msg2`, `school_history`, `location`, `present`) VALUES
(1, '   +105673+hahs105673@gmail.com+01705100106', 'https://facebook.com/official.anauv/+https://www.twitter.com/+https://www.linkedin.com/+https://www.plus.google.com/', 'Chairman Message+Homna Adarsha High School started its rich tradition in 1989. The motto of this school is to make the students worthy citizens and able leaders to serve the country. Besides academic programmes, we do duly emphasize activities to explore their hidden talents. Our efforts are also directed to ensure their sound state of mind and body.  It really gives me immense pleasure to learn that the students of Homna Adarsha High School are groomed with digital contents and well acquainted with the ICT devices to face the challenges of the 21st century and globalization.  I wish Homna Adarsha high school will keep up its better tempo of excellence in the years to come.+309522551_founder_img.png', 'Head Teachers Message+Welcome to the Homna Adarsha High School website. As you read through the pages of this site, you will learn about our students, teachers, SMC members, our school and get feel for the vibrancy and strength of our wider Homna Adarsha High School community.  The magnificently designed Homna Adarsha High School was established in the years 1989. The institution stands in the heart of Homna upazila porishod. We consider every student as unique and so we maintain inclusive learning teaching environment at every step in our great set-up.  In an era of Information and Communication technology, due emphasis should be given on imparting knowledge on information technology along with high standard general educational in order to make our students worthy citizens of the present high teach world with this end in view, Homna Adarsha High School has opened a website so that everybody including students, guardians and ex-students of this school may be well informed of all the information and activities of the school. In Addition, classes are being conducted by efficient teachers with the help of smart board and multimedia, thereby enabling students to assimilate their lessons easily and effectively. The process of digitization is progressing steadily.  I am quite optimistic that we shall be able to achieve leading position in the field of education not only in Bangladesh but also in the international arena with the introduction of these modern systems and devices.+1688940550_headmaster_img.png', ' School History+<p> :                .                    . .                      &ldquo;   &rdquo;  ,          .         &nbsp; &nbsp;                         &nbsp;                          &nbsp; &nbsp;   &nbsp;      &nbsp;           </p>\r\n<p>&nbsp;  .&nbsp;          &nbsp;                 &nbsp; &nbsp;    .            &nbsp;      .        .                  ,  &nbsp;       &nbsp;                   &nbsp;            &nbsp;            -       ,     -            &nbsp;  &ldquo;   &rdquo;        , ,   ()                            ,           &nbsp; &nbsp;     -         ,   ,  ,    ,  ,  ,  ,           ,  ,                       -</p>\r\n<p style="text-align: justify;">  :                                                                         &nbsp;                                    ,              </p>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d912.8309749588451!2d90.43068982917363!3d23.771477699036172!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3755c78cd50432a3%3A0x701953e14150c231!2sAnanda+Nagar+Rd%2C+Dhaka+1212!5e0!3m2!1sen!2sbd!4v1490215527170" width="400" height="300" frameborder="0" style="border:0" allowfullscreen></iframe>', 1);
